    [],nt"revision_timestamp": "2016-07-27T22:45:50.832241",nt"name": "narrative-report-for-calendar-year-1967",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Devils Lake Wetland
    Management District outlines Refuge accomplishments for the calendar year of 1967.
    The report begins by summarizing the water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, fur animals, predators,
    rodents, and other mammals, fish, reptiles, and disease- is also covered. The Refuge
    development and maintenance section discusses physical developments, plantings,
    vegetation control, and fires. Resource management is outlined; topics include grazing
    and fur harvesting. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, violations, and safety. Items
    of interest, N-R forms, and photographs are attached.",nt"license_title": "License
